    [],nt"revision_timestamp": "2015-11-25T17:35:20.296745",nt"name": "gpm-gmi-level-1c-common-calibrated-brightness-temperatures-collocated-v03",nt"isopen":
    true,nt"url": null,nt"notes": "All 1C products have a common L1C data structure,
    simple and generic. Each L1C swath includes scan time, latitude and longitude, scan
    status, quality, incidence angle, Sun glint angle, and the intercalibrated brightness
    temperature (Tc). One or more swaths are included in a product. The radiometer data
    are recalibrated to a common basis so that precipitation products derived from them
    are consistent. 1CGMI contains common calibrated brightness temperatures from the
    GMI passive microwave instrument flown on the GPM satellite. 1C-R GMI is a remapped
    version of 1CGMI which is explained at the end of this section. Swath S1 has 9 channels
    which are similar to TRMM TMI (10V 10H 19V 19H 23V 37V 37H 89V 89H). Swath S2 has
    4 channels similar to AMSU-B (166V 166H 183+/-3V 183+/-8V). Data for both swaths
    is observed in the same revolution of the instrument.The purpose of Level 1C algorithms
    is to provide common intercalibrated microwave brightness temperature (Tc) products
    for GPM core and constellation satellites using the GPM Microwave Imager (GMI) as
    the reference standard to ensure the consistency among global precipitation retrieval
    and climate studies. Current available L1C products are listed in the following
    table found in the document Introduction To Data Products ("http://pps.gsfc.nasa.gov/Documents/IntroductionToDataProducts.pdf")",nt"license_title":
